import React from "react";
import { Box } from "@mui/material";
import { useLocation } from "react-router-dom";
import {useDispatch} from "react-redux";
import {triggerProgressBar} from "../../Actions/index";

const Tryon = () => {
    const location= useLocation();
    const dispatch = useDispatch();
  return (

    <>
{dispatch(triggerProgressBar(location.pathname))}
      <Box sx={{ mt: 4, height: "100vh", ml: 1, mr: 1 }}>
        <iframe
          src="https://dinahawiditesting.as.me/schedule.php"
          title="Schedule Appointment"
          width="100%"
          height="100%"
          frameBorder="0"
        ></iframe>
      </Box>
    </>
  );
};
export default Tryon;
